import React from 'react';


function Footer() {
  return (
    <Box padding={8}>
      <Center>
        <Heading size="sm">Powered by Redis and Golang</Heading>
      </Center>
      <Center>
        <Heading fontStyle={'italic'} size="sm" paddingTop={2}>
          Made by{' '}
          <a href="https://github.com/dmytrodemianchuk" rel="noreferrer" target={'_blank'}>
            Dmytro Demianchuk
          </a>
        </Heading>
      </Center>
    </Box>
  );
}

export default Footer;
